import "./index.css";

const person = {
  nombre: "Rimuru",
  apellido: "Tempest",
  nombreCompleto: function () {
    return this.nombre + " " + this.apellido;
  },
  edad: "2",
  direccion: {
    region: "Jura Tempest",
    ciudad: "Ciudad de Rimuru",
  },
  ocupacion: "Demon Lord",
  saludo: function () {
    return `Hola soy ${this.nombreCompleto}, no soy un slime malo!`;
  },
};

console.log(person.saludo);
console.table(person);
